import { Navbar, Nav, NavDropdown, Button } from 'react-bootstrap';
import AdminStyleSheet from '../style-sheets/adminStyleSheet';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSearch } from '@fortawesome/free-solid-svg-icons';


const AdminToolbar = () => (
  <div>
    <Navbar collapseOnSelect expand="lg" style={AdminStyleSheet.background} variant="dark">
      <Navbar.Brand href="/" className="mr-auto">Muhalik</Navbar.Brand>
      <Navbar.Brand href="#home" className="mr-auto">Admin Dashboard</Navbar.Brand>
      <Nav>
        <NavDropdown title="Setting" id="basic-nav-dropdown" split alignRight>
          <div className="hoverr"><NavDropdown.Item href="#action/3.1">Acount Setting</NavDropdown.Item></div>
          <NavDropdown.Item href="#action/3.2">Send Feedback</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Help?</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Signout</NavDropdown.Item>
        </NavDropdown>
      </Nav>
    </Navbar>
    <style jsx> {`
        .hoverr:hover {
            margin-left: 10px;
            background: red;
        }
     `} </style>
  </div>
);

export default AdminToolbar;

{/* 563D7C E35300 */ }
